public class Solution {
    public bool HasTrailingZeros(int[] nums) {
        // Iterate through each bit position (0 to 6)
        for (int bit = 0; bit <= 6; bit++) {
            bool hasZero = false;
            bool hasNonOne = false;

            foreach (int num in nums) {
                if ((num & (1 << bit)) == 0) {
                    hasZero = true; // This number has a 0 in the current bit position
                } else {
                    hasNonOne = true; // This number does not have a 1 in the current bit position
                }

                if (hasZero && hasNonOne) {
                    return true; // Found two numbers that ensure a trailing zero
                }
            }
        }
        return false; // No combination found that ensures a trailing zero
    }
}
